function RecipeShow(recipe) {
    const recipeId = recipe.recipe.id;
    return(
        <div>
            <h1>Recipe: {recipeId}</h1>
            <pre>
                {JSON.stringify(recipe, null, 4)}
            </pre>
        </div>
    );
}

export default RecipeShow;
